import React from "react";
import Button from "@mui/material/Button";
import NavBar from "./NavBar";
import logo from "../assets/logo.png";
import WhatsAppIcon from "@mui/icons-material/WhatsApp";
import GitHubIcon from "@mui/icons-material/GitHub";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import InstagramIcon from "@mui/icons-material/Instagram";
import FacebookRoundedIcon from "@mui/icons-material/FacebookRounded";
import CloudDownloadTwoToneIcon from "@mui/icons-material/CloudDownloadTwoTone";
function Home() {
  return (
    <div>
      <NavBar />
      <section className=" text-light mt-5">
        <div className="flex">
            <div className="order-md-1">
              <h3> Hello ,it's Me </h3>
              <h2> Elhaddad Abdelmounaim </h2>
              <h2>
                {" "}
                And I'm a
                <span style={{ color: "#04BFCE" }}>full-stack developer</span>
              </h2>
              <p className="mt-4">
                Lorem ipsum dolor sit, amet consectetur adipisicing elit. Facere
                vero debitis autem veritatis ut, provident minus quae expedita
                culpa ipsam!
              </p>
              <div className="my-2">
                <span className="ms-1" style={{ cursor: "pointer" }}>
                  {" "}
                  <WhatsAppIcon sx={{ fontSize: 40 }} color="success" />{" "}
                </span>
                <span className="ms-1" style={{ cursor: "pointer" }}>
                  <GitHubIcon sx={{ fontSize: 40 }} />
                </span>
                <span className="ms-1" style={{ cursor: "pointer" }}>
                  <LinkedInIcon sx={{ fontSize: 40 }} />
                </span>
                <span className="ms-1" style={{ cursor: "pointer" }}>
                  <InstagramIcon sx={{ fontSize: 40 }} />
                </span>
                <span className="ms-1" style={{ cursor: "pointer" }}>
                  <FacebookRoundedIcon sx={{ fontSize: 40 }} />
                </span>
              </div>
              <div className="mt-3">
                <Button
                  variant="contained"
                  endIcon={<CloudDownloadTwoToneIcon />}
                >
                  {" "}
                  Download CV{" "}
                </Button>
              </div>
            </div>
            <div className=" order-md-0">
              <div className="ms-5">
                <img src={logo}  style={{ width:'90%' }} alt="" className=" ms-3 img-fluid" />
              </div>
            </div>

        </div>
      </section>
    </div>
  );
}

export default Home;
